void reference_init(reference_generation_t *r)
{

    r->waveform_size = REF_GEN_DEFAULT_SIZE;
    r->waveform_index = 0;
    r->type = 1;
    r->cycle_completed = false;

    RAMPGEN_reset(&(r->rgen));
    r->rgen.freq = (float32_t)(60); //60 Hz
    r->rgen.stepAngleMax = (float32_t)(1.0/INV_PWM_SWITCHING_FREQUENCY);
}


float test_ref = 0.0;
#pragma CODE_SECTION(reference_routine, ".TI.ramfunc")
float reference_routine(reference_generation_t *r)
{
    float rk;
    r->cycle_completed = false;

    switch(r->type)
    {
    case 1:
        rk = r->waveform1[r->waveform_index++];
        break;
    case 2:
        rk = r->waveform2[r->waveform_index++];
        break;
    case 3:
        rk = sinus1[r->waveform_index++];
        break;
    case 4:
        rk = phase90fired[r->waveform_index++];
        break;
    case 5:
        rk = square_1000[r->waveform_index++];
        break;
    case 6:
        rk = tri[r->waveform_index++];
        break;
    case 10:
        RAMPGEN_run(&(r->rgen)); //do not use this in repetitive mode
        rk = sinf((r->rgen.out)*CONST_2PI_32);
        break;
    case 11:
        rk = test_ref;//do not use this in repetitive mode
        break;
    default:
        rk = 0.0;//do not use this in repetitive mode
        break;
    }
    if(r->waveform_index>=r->waveform_size)
    {
        r->waveform_index=0;
        r->cycle_completed = true;
    }

    return rk;
}
